import {API} from "../../backend";

export const getProducts=()=>{
    return fetch(`${API}product/`,{method:"GET"})
    .then((response) =>{
        try{
            const data= response.json()
            console.log('response data',data);
        }
        catch(error)
        {console.log('error happend')
        console.error(error);
        return response.json()
     } })
